[{"location":"#Parrot","page":"Home","title":"Parrot","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"A neural network framework for emulating stellar population synthesis. Written in Julia.","category":"page"},{"location":"#Installation","page":"Home","title":"Installation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"First, please install Julia on your system by following the steps listed on the Julia website. This package is currently being developed and tested on Julia v1.5, but it will likely work with earlier versions as well.","category":"page"},{"location":"","page":"Home","title":"Home","text":"To install Parrot, open a Julia REPL and type ] (to enter the Pkg REPL) followed by:","category":"page"},{"location":"","page":"Home","title":"Home","text":"add https://github.com/elijahmathews/Parrot.jl.git","category":"page"},{"location":"","page":"Home","title":"Home","text":"Or alternatively, run the following code directly at the Julia REPL:","category":"page"},{"location":"","page":"Home","title":"Home","text":"julia> import Pkg; Pkg.add(url=\"https://github.com/elijahmathews/Parrot.jl.git\")","category":"page"},{"location":"#Overview","page":"Home","title":"Overview","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"At the moment, Parrot is in development, but the intent is to create a package that will aid in emulating stellar population synthesis (SPS) codes using neural networks. The package is currently being designed under the Flux machine learning ecosystem.","category":"page"}]
